export const shopdata=React.createContext()

export  function Context({children}) {
  const data=
  [
    {
        id:1,
        name:"iphone",
        cost:9999,
        image:shop1
    },
    {
        id:2,
        name:"camera",
        cost:9999
    },
    {
        id:3,
        name:"shirt",
        cost:9999
    },
    {
        id:3,
        name:"iphone",
        cost:9999
    },
  ]
  const totaldata={
    data
  }
  return (
    <shopdata.Provider value={totaldata}>
        {children}
    </shopdata.Provider>
  )
}
